import { BrowserRouter, Routes, Router } from 'react-router-dom';
import Main from './pages/Main';

function App() {
  return (
    <div className="App">
      <Routes>
       <Route path="/" component={Main}/>

      </Routes>

    </div>
  );
}

export default App;
